export {};
hopp.test('parseInt works', () => {
  console.log('typeof parseInt:', typeof parseInt)
  const numStr = hopp.env.active.get('number_string')
  console.log('numStr:', numStr, 'type:', typeof numStr)
  const num = parseInt(numStr)
  console.log('parseInt result:', num, 'type:', typeof num)
  const expectResult = hopp.expect(num)
  console.log('hopp.expect returned:', typeof expectResult)
  console.log('expectResult.toBeGreaterThan:', typeof expectResult.toBeGreaterThan)
  console.log('expectResult keys:', Object.keys(expectResult))
  expectResult.toBeGreaterThan(0)
})
